  return (
    <div className="App">
      <h1 id="Titre">
        Temperature des cours d'eau
      </h1>
      <div className="ListStations">
        <h1>Liste des stations</h1>
        <div className="Stations">
          <h1 onClick>{arrayStations}</h1>
        </div>
      </div>

      {/* <header className="App-header">
      </header> */}
    </div>
  );
}

export default App;
